//Model 页面
export const model = {

    localhost : "http://localhost:8080/",

    //厨师渲染数据
    fetch1:function* (){

      const response = yield fetchb(this.localhost)

      const data = yield change(response)

      return data   
    },
        //
    change:function* (fedata,data1){

      yield fetchc(this.localhost+fedata,data1)

      const data2 = yield this.fetch1()

      return data2
    },
    datamql3 :function* (val){
      const data1 = yield val.data

      const fedata = yield val.data2

      const response = yield fetchc(this.localhost+fedata,data1)

      const data2 = yield this.change(response)

      return data2
    }
}
